    matrix = [[int(i) for i in stdin.split()] for _ in range(n)]

    def is_palindromic(i, j, matrix):
        # Palindromic if row and column don't change and the cell is the same
        # Otherwise, change it to the next number in the sequence
        if i == j:
            return matrix[i][j] == matrix[i][j]

        if matrix[i][j]!= matrix[i][j]:
            return False

        # Change it to the next number in the sequence
        matrix[i][j] = matrix[i][j] * 10 + matrix[i][j] % 10 + 1

        # Change the row and column if needed
        if i > 0:
            is_palindromic(i - 1, j, matrix)
        if j > 0:
            is_palindromic(i, j - 1, matrix)
        if i < n - 1:
            is_palindromic(i + 1, j, matrix)
        if j < n - 1:
            is_palindromic(i, j + 1, matrix)

    # Check the matrix
    for row in range(n):
        for col in range(n):
            is_palindromic(row, col, matrix)

    # Print the result
    for row in matrix:
        print(' '.join(str(i) for i in row))

