class Polycarp:
    def __init__(self, n: int, m: int, a: list[int]):
        self.n = n
        self.m = m
        self.a = a
        self.t = [[] for _ in range(n)]

    def days_to_write(self) -> int:
        self.t = [[] for _ in range(self.n)]

        if self.m == 0:
            return -1

        for i, a in enumerate(self.a):
            self.t[i].append(a)

        dp = [float('inf')] * (self.n + 1)
        dp[0] = 0

        for i in range(self.n):
            for j in range(i + 1):
                if j == 0:
                    dp[i + 1] = min(dp[i + 1], dp[j] + 1)
                elif j == i:
                    dp[i + 1] = min(dp[i + 1], dp[j - 1] + 1)
                else:
                    dp[i + 1] = min(dp[i + 1], dp[j - 1] + 1, dp[j] + 1)

        return dp[self.n] if dp[self.n]!= float('inf') else -1

