    def change(b: list, i: int) -> bool:
        if i < 0:
            return False
        elif i == 0:
            return True
        elif b[i] == 0:
            return False
        elif b[i] == 1:
            for j in range(i - 1, i + 2):
                if b[j] > 1:
                    b[j] -= 1
                    return True
        elif b[i] > 1:
            b[i] -= 1
            return True

    def possible(b: list) -> bool:
        for i in range(1, len(b)):
            if b[i]!= b[i - 1]:
                return False
        return True

    def polycarp(b: list) -> int:
        i = 0
        while i < len(b):
            if i == 0:
                i += 1
                continue
            if change(b, i):
                if not possible(b):
                    return -1
                i += 1
            else:
                b[i] = 0
                i -= 1
                if b[i] == 1:
                    b[i] += 1
        return b

    return str(polycarp(b)[1:])

