    N = int(stdin.readline().strip())
    sticks = [int(stdin.readline()) for _ in range(N)]

    # Create a trie for each length and add the triple to the trie
    # with all other triples that share the same length
    # and share the same first element.
    tries = []
    for length in set(sticks):
        trie = Trie()
        for i, j, k in combinations(sticks, 3):
            if i == j == k:
                continue
            if i == j or i == k or j == k:
                trie.add(length, (i, j, k))
        tries.append(trie)

    # Search for triples in each trie and count
    # the number of triples
    total_triples = 0
    for trie in tries:
        for length, _ in trie.keys():
            for i, j, k in trie.keys():
                if length == i == j == k:
                    continue
                if length == i == k or length == j == k:
                    continue
                if i < j < k:
                    total_triples += 1

    return str(total_triples)


class Trie:
    def __init__(self):
        self.children = {}
        self.end = False

    def add(self, length: int, triple: tuple) -> None:
        if length not in self.children:
            self.children[length] = Trie()
        self.children[length].add(length, triple)

    def count(self) -> int:
        count = 0
        for length, child in self.children.items():
            count += child.count()
        return count

