    for a, b in courier:
        routes[a, b] = paths[0][0]
        paths[0][0].append(b)

    # remove used paths
    for path in paths[1:]:
        for a, b in routes:
            if a in path and b in path:
                del routes[a, b]
                break

    # build the routes
    for a, b in courier:
        if a == b:
            continue

        routes[a, b] = routes[b, a] = list(set(paths[0][0]) - set(paths[a]))[0]

    # find the shortest route
    total = sys.maxsize
    for a, b in courier:
        total = min(total, calc_cheapest(a, b, routes))

