    # Base case
    if capacity == 0:
        return 0

    # Top-down dynamic programming
    def maximum_capacity(weights, capacity, index):
        # If we have exhausted the weights, return 0
        if index >= len(weights):
            return 0

        # When we have exhausted the weights, we can never go further
        if capacity == 0:
            return 0

        # Otherwise, we choose to eat the current weight or not
        # To eat the weight, we can either skip the current weight or eat the current weight
        eat_or_not_1 = weights[index] + maximum_capacity(weights, capacity - weights[index], index + 1)
        eat_or_not_2 = maximum_capacity(weights, capacity, index + 1)
        return max(eat_or_not_1, eat_or_not_2)

    return str(maximum_capacity(weights, capacity, 0))

