def solution(stdin: str) -> str:
    n, *room_sizes = [int(x) for x in stdin.strip().split()]
    if n < 2 or n > 30:
        return "impossible"

    total_students = sum(room_sizes)

    if total_students < n:
        return "impossible"

    if total_students == n:
        return " ".join(map(str, range(1, n + 1)))

    room_sizes.sort(reverse=True)

    first_room_exams = sum(room_sizes)
    last_exams = 0

    for i in range(n):
        last_exams += room_sizes[i]
        last_exams -= room_sizes[i] % n

    if first_room_exams < n:
        return "impossible"

    if last_exams > 0:
        return "impossible"

    return " ".join(map(str, range(1, n + 1)))

